    out1[0] = 0x33ffffffffff;
    out1[1] = cast(u64, 0x0);
    out1[2] = cast(u64, 0x0);
    out1[3] = cast(u64, 0x0);
    out1[4] = 0xffdfffffffffff;
    out1[5] = 0xffffffffffffff;
    out1[6] = 0xffffffffffffff;
    out1[7] = 0xffffffffffffff;
}

/// The function jumpdivstepPrecompHd returns the precomputed value for the (half-delta) jump-version of Bernstein-Yang-inversion (in montgomery form).
///
/// Postconditions:
///   eval out1 = ⌊(m - 1) / 2⌋^(if (log2 m) + 1 < 46 then ⌊(49 * ((log2 m) + 1) + 80) / 17⌋ else ⌊(49 * ((log2 m) + 1) + 57) / 17⌋)
///
pub fn jumpdivstepPrecompHd(out1: *TightFieldElement) void {
    @setRuntimeSafety(mode == .Debug);

    out1[0] = cast(u64, 0x0);
    out1[1] = 0xffffffffffe000;
    out1[2] = 0xffffffffffffff;
    out1[3] = 0xffffffffffffff;
    out1[4] = 0xffffffffffffff;
    out1[5] = 0x13ff;
    out1[6] = cast(u64, 0x0);
    out1[7] = cast(u64, 0x0);
}
